import React, { Component } from "react";
import { getGenres } from "../services/fakeGenreService";

const GenresList = () => {
  const genres = getGenres();
  return (
    <ul className='list-group'>
      {genres.map((g) => (
        <li key={g} className='list-group-item'>
          {g.name}
        </li>
      ))}
    </ul>
  );
};

export default GenresList;
